PRAGMA foreign_keys=ON;
BEGIN TRANSACTION;
CREATE TABLE sample_areas(
cluster_name text,
country_or_subcluster text,
demo_site text,
sample_area_location text,
sample_area_number integer primary key,
land_use_stage text,
field_type text,
date text,
researcher text,
farmer text,
notes text);
Mazagao',18,'Fallow','Restinga','01.08.1998','Fernando','11','');
Mazagao',19,'Fallow','Restinga','01.04.1999','Fernando','3','');
CREATE TABLE species_list(
local_name text,
scientific_name text,
species_id integer primary key);
CREATE TABLE plot_description(
sample_area_number integer references sample_areas(sample_area_number),
plot_number integer primary key,
plot_size text,
land_tenure text,
resource_tenure text,
elevation double,
steepness double,
aspect text,
soil_type text,
moisture_status text,
date text,
researcher text,
notes text);
CREATE TABLE utility_data (
id integer primary key,
plot_number integer references plot_description(plot_number),
species_id integer references species_list(species_id),
food boolean,
medicine boolean,
construction boolean,
crafts boolean,
commerce boolean,
other text,
notes text);
CREATE TABLE species_data(
id integer primary key,
plot_number integer references plot_description(plot_number),
species_id integer references species_list(species_id),
abundance integer,
utility boolean,
date text,
researcher text,
notes text);
CREATE TABLE tree_data(
plot_id integer references species_data(plot_number),
tree_tag_number integer primary key,
species_id integer references species_list(species_id),
dbh double,
height integer,
researcher text,
date text,
notes text);
COMMIT;
